   "source": [
    "# 1. Библиотеки\n",
    "suppressPackageStartupMessages({\n",
    "    library(tidyverse)\n",
    "    library(cluster)\n",
    "    library(factoextra)\n",
    "})\n",
    "\n",
    "# 2. Загрузка\n",
    "df <- read.csv(\"/kaggle/input/clustering-exercises/isolation.csv\")\n",
    "\n",
    "# Берем только координаты (убираем color)\n",
    "X_raw <- df %>% select(x, y)\n",
    "\n",
    "# 3. Масштабирование\n",
    "scale_df <- scale(X_raw)\n",
    "scale_df_frame <- as.data.frame(scale_df) # Для ggplot\n",
    "\n",
    "# Вычисляем матрицу Манхэттенских расстояний \n",
    "dist_man <- dist(scale_df, method = \"manhattan\")\n",
    "\n",
    "# 4. Определение оптимального числа кластеров\n",
    "set.seed(123)\n",
    "\n",
    "# График локтя (WSS) \n",
    "p1 <- fviz_nbclust(scale_df, pam, method = \"wss\", diss = dist_man) +\n",
    "  ggtitle(\"Метод локтя (WSS) - Manhattan\") +\n",
    "  geom_vline(xintercept = 4, linetype = 2) # Предположим, что излом на 4\n",
    "\n",
    "# График силуэта\n",
    "p2 <- fviz_nbclust(scale_df, pam, method = \"silhouette\", diss = dist_man) +\n",
    "  ggtitle(\"Метод силуэта - Manhattan\")\n",
    "\n",
    "# Выводим графики выбора K\n",
    "print(p1)\n",
    "print(p2)\n",
    "\n",
    "k_best <- 4 \n",
    "\n",
    "# 5. Кластеризация (PAM с Manhattan)\n",
    "final_model <- pam(dist_man, k = k_best, diss = TRUE)\n",
    "\n",
    "# Добавляем метки кластеров\n",
    "scale_df_frame$cluster <- factor(final_model$clustering)\n",
    "\n",
    "# 6. Центры кластеров\n",
    "medoids_indices <- final_model$id.med\n",
    "centers <- scale_df_frame[medoids_indices, c(\"x\", \"y\")]\n",
    "centers$cluster <- factor(1:k_best)\n",
    "\n",
    "print(\"Центры кластеров (skaled):\")\n",
    "print(centers)\n",
    "\n",
    "ggplot(scale_df_frame, aes(x = x, y = y, color = cluster)) +\n",
    "  geom_point(size = 2, alpha = 0.7) +\n",
    "  geom_point(data = centers, aes(x = x, y = y),\n",
    "             color = \"black\", shape = 4, size = 5, stroke = 3) + \n",
    "  labs(title = paste(\"K-Medoids (PAM) Clustering, K =\", k_best),\n",
    "       subtitle = \"Метрика: Manhattan. Черные кресты - центры.\",\n",
    "       x = \"X coordinate\", y = \"Y coordinate\") +\n",
    "  theme_minimal()\n",
    "\n"
   ]
  },
