    "Ну кластеризация получилось не очень, но с этим методом лучше бы не было, он не подходит сюда, потому что он пытается минимизировать расстоиние до центра и кластеры получаются выпуклые. По методу локтя видно, что после 4 идет достаточно сильный перелом, по методу силуэтов четверка сильно не выделяется, но брать 9 это уже перебор. Поэтому было решено взять 4. Результат получился не очень, кластеры не интерпретируются. Но тут либо взять два кластера, которые легко объяснить, но они тупо попилят все пополам, либо брать 9 кластеров, что может иметь слегка больше смысла, но это не рационально. Результат в целом на 2\\10\n",
