    "suppressPackageStartupMessages({\n",
    "    library(tidyverse)\n",
    "    library(cluster)     \n",
    "    library(proxy)      \n",
    "    library(factoextra)  \n",
    "    library(gridExtra)   \n",
    "})\n",
    "\n",
    "# 1. Загрузка и подготовка\n",
    "df <- read.csv(\"/kaggle/input/clustering-exercises/hyperplane.csv\")\n",
    "\n",
    "X_raw <- df[, 1:2]\n",
    "colnames(X_raw) <- c(\"x\", \"y\")\n",
    "\n",
    "X_scaled <- scale(X_raw)\n",
    "\n",
    "# 2. Функция автоподбора K (Silhouette)\n",
    "auto_k <- function(data_matrix, metric_name, max_k = 8) {\n",
    "    best_k <- 2\n",
    "    best_sil <- -1\n",
    "    \n",
    "    std_metrics <- c(\"euclidean\", \"manhattan\", \"maximum\", \"canberra\", \"binary\", \"minkowski\")\n",
    "    \n",
    "    if (tolower(metric_name) %in% std_metrics) {\n",
    "        d <- dist(data_matrix, method = tolower(metric_name))\n",
    "    } else {\n",
    "        d <- proxy::dist(data_matrix, method = metric_name)\n",
    "    }\n",
    "    \n",
    "    for (k in 2:max_k) {\n",
    "        model <- pam(d, k = k, diss = TRUE)\n",
    "        curr_sil <- model$silinfo$avg.width\n",
    "        \n",
    "        if (curr_sil > best_sil) {\n",
    "            best_sil <- curr_sil\n",
    "            best_k <- k\n",
    "        }\n",
    "    }\n",
    "    return(list(k = best_k, sil = best_sil, dist = d))\n",
    "}\n",
    "\n",
    "# 3. Перебор метрик\n",
    "metrics_to_test <- c(\"Euclidean\", \"Manhattan\", \"Chebyshev\", \"Canberra\", \"Cosine\", \"Correlation\")\n",
    "plot_list <- list()\n",
    "results_text <- data.frame(Metric=character(), K=integer(), Silhouette=numeric())\n",
    "\n",
    "cat(\"Начинаем анализ метрик...\\n\")\n",
    "\n",
    "for (met in metrics_to_test) {\n",
    "    # 1. Находим оптимальное K\n",
    "    res <- auto_k(X_scaled, met)\n",
    "    \n",
    "    results_text <- rbind(results_text, data.frame(Metric=met, K=res$k, Silhouette=res$sil))\n",
    "    \n",
    "    # 2. Строим модель\n",
    "    final_pam <- pam(res$dist, k = res$k, diss = TRUE)\n",
    "    \n",
    "    # 3. Готовим данные для графика\n",
    "    plot_df <- as.data.frame(X_scaled)\n",
    "    plot_df$cluster <- factor(final_pam$clustering)\n",
    "    \n",
    "    title_str <- paste0(met, \"\\n(k=\", res$k, \", sil=\", round(res$sil, 2), \")\")\n",
    "    \n",
    "    # 4. Рисуем\n",
    "    p <- ggplot(plot_df, aes(x = x, y = y, color = cluster)) +\n",
    "        geom_point(size = 0.8, alpha = 0.7) +\n",
    "        theme_minimal(base_size = 10) +\n",
    "        theme(legend.position = \"none\",\n",
    "              plot.title = element_text(hjust = 0.5, size = 10)) +\n",
    "        labs(title = title_str, x = NULL, y = NULL)\n",
    "    \n",
    "    plot_list[[met]] <- p\n",
    "}\n",
    "\n",
    "# 4. Вывод сводной таблицы\n",
    "cat(\"\\n=== Результаты сравнения ===\\n\")\n",
    "print(results_text %>% arrange(desc(Silhouette)))\n",
    "\n",
    "best_metric <- results_text[which.max(results_text$Silhouette), \"Metric\"]\n",
    "cat(\"\\n>>> Победитель: \", best_metric, \"\\n\")\n",
    "\n",
    "# 5. Вывод всех графиков фасеткой\n",
    "grid.arrange(grobs = plot_list, ncol = 3, \n",
    "             top = \"Сравнение кластеризации (hyperplane) с разными метриками\")\n"
   ]
  },
