   "source": [
    "Количество кластеров в каждом варианте оценивалось по максимальному среднему силуэту при разном количестве кластеров. Силуэт считался, потому что здесь в отличие, от других заданий сразу в глаза не бросается картинка, которую можно очевидно попилить на кластеры. \n",
    "По итогу в принципе почти все метрики, на мой взгляд, справились нормально, кроме корреляционных расстояний, там все плохо, ну оно и понятно почему, корреляции у точек здесь нет.\n",
    "Если и выделять, то канберра и косинусное сходство справились лучше всех. Границы между кластерами более-менее четкие, в случае канберры, они еще и адекватно интерпретируются"
   ]
  },
