   "source": [
    "suppressPackageStartupMessages({\n",
    "    library(tidyverse)\n",
    "    library(cluster)     # pam, clara, fanny\n",
    "    library(proxy)       # метрики\n",
    "    library(factoextra)  # графики\n",
    "    library(gridExtra)   # сетка графиков\n",
    "})\n",
    "\n",
    "# 1. Загрузка данных\n",
    "cat(\"Загрузка blob.csv...\\n\")\n",
    "df <- read.csv(\"/kaggle/input/clustering-exercises/blob.csv\")\n",
    "\n",
    "# Берем только координаты (1-2 колонки)\n",
    "X_raw <- df[, 1:2]\n",
    "colnames(X_raw) <- c(\"x\", \"y\")\n",
    "X_scaled <- scale(X_raw)\n",
    "\n",
    "# 2. Перебор метрик (Алгоритм PAM - K-Medoids)\n",
    "# Это покрывает требование \"все возможные расстояния\"\n",
    "metrics_list <- c(\"Euclidean\", \"Manhattan\", \"Canberra\", \"Chebyshev\", \"Cosine\", \"Correlation\")\n",
    "results_stats <- data.frame()\n",
    "plot_list <- list()\n",
    "\n",
    "# Функция для подбора K\n",
    "find_k <- function(dist_mat, max_k=8) {\n",
    "    best_k <- 2; best_sil <- -1\n",
    "    for(k in 2:max_k) {\n",
    "        s <- pam(dist_mat, k=k, diss=TRUE)$silinfo$avg.width\n",
    "        if(s > best_sil) { best_sil <- s; best_k <- k }\n",
    "    }\n",
    "    return(list(k=best_k, sil=best_sil))\n",
    "}\n",
    "\n",
    "cat(\"--- Этап 1: Сравнение метрик (PAM) ---\\n\")\n",
    "for(met in metrics_list) {\n",
    "    # Считаем матрицу расстояний\n",
    "    if(tolower(met) %in% c(\"euclidean\", \"manhattan\")) {\n",
    "        d <- dist(X_scaled, method=tolower(met))\n",
    "    } else {\n",
    "        d <- proxy::dist(X_scaled, method=met)\n",
    "    }\n",
    "    \n",
    "    # Ищем лучшее K\n",
    "    k_info <- find_k(d)\n",
    "    \n",
    "    # Строим модель\n",
    "    model <- pam(d, k=k_info$k, diss=TRUE)\n",
    "    \n",
    "    # Сохраняем статистику\n",
    "    results_stats <- rbind(results_stats, \n",
    "                           data.frame(Method=\"PAM\", Metric=met, K=k_info$k, Silhouette=k_info$sil))\n",
    "    \n",
    "    # График\n",
    "    p_df <- as.data.frame(X_scaled)\n",
    "    p_df$cluster <- factor(model$clustering)\n",
    "    \n",
    "    plot_list[[met]] <- ggplot(p_df, aes(x=x, y=y, color=cluster)) +\n",
    "        geom_point(size=0.8, alpha=0.6) +\n",
    "        labs(title=paste0(met, \"\\n(K=\", k_info$k, \", S=\", round(k_info$sil, 2), \")\"), \n",
    "             x=NULL, y=NULL) +\n",
    "        theme_minimal() + theme(legend.position=\"none\", plot.title=element_text(size=9))\n",
    "}\n",
    "\n",
    "# 3. Модификация: Fuzzy C-Means (Мягкая кластеризация)\n",
    "# Работает с Евклидом по умолчанию\n",
    "cat(\"--- Этап 2: Fuzzy C-Means ---\\n\")\n",
    "fanny_res <- fanny(X_scaled, k=3) # Пробуем K=3 (стандарт для blob)\n",
    "fanny_sil <- fanny_res$silinfo$avg.width\n",
    "results_stats <- rbind(results_stats, \n",
    "                       data.frame(Method=\"Fuzzy C-Means\", Metric=\"Euclidean\", K=3, Silhouette=fanny_sil))\n",
    "\n",
    "# Добавляем график Fuzzy\n",
    "p_df <- as.data.frame(X_scaled)\n",
    "p_df$cluster <- factor(fanny_res$clustering)\n",
    "plot_list[[\"Fuzzy\"]] <- ggplot(p_df, aes(x=x, y=y, color=cluster)) +\n",
    "    geom_point(size=0.8, alpha=0.6) +\n",
    "    labs(title=paste0(\"Fuzzy C-Means\\n(K=3, S=\", round(fanny_sil, 2), \")\"), \n",
    "         x=NULL, y=NULL) +\n",
    "    theme_minimal() + theme(legend.position=\"none\", plot.title=element_text(size=9, color=\"blue\"))\n",
    "\n",
    "\n",
    "# 4. Вывод результатов\n",
    "cat(\"\\n=== Итоговая таблица ===\\n\")\n",
    "print(results_stats %>% arrange(desc(Silhouette)))\n",
    "\n",
    "cat(\"\\n>>> Лучшая комбинация: \", results_stats$Metric[which.max(results_stats$Silhouette)], \n",
    "    \" с методом \", results_stats$Method[which.max(results_stats$Silhouette)], \"\\n\")\n",
    "\n",
    "# Рисуем все вместе\n",
    "grid.arrange(grobs=plot_list, ncol=3, top=\"Анализ blob.csv: Метрики и Методы\")\n"
   ]
  },
