   "source": [
    "Тут ситуация такая же, как и в прошлом задании, поэтому прибегнул к использованию оценки силуэта. Канбера с pam дала лучший результат. Коэффициент силуэта получился внушительный. \n",
    "Да и в целом все метрики с pam дали хорошие результаты, просто в канберре разница между кластерами более четкая и меньше точек, о принадлежности которых возникают вопросы. "
